/* Function: mdlTerminate =====================================================
 * Abstract:
 *    In this function, you should perform any actions that are necessary
 *    at the termination of a simulation.  For example, if memory was
 *    allocated in mdlStart, this is the place to free it.
 */
static void mdlTerminate(SimStruct *S)
{
  void **pW = ssGetPWork(S);
  real_T *xD = ssGetDiscStates(S);
  real_T *xC = ssGetContStates(S);
  const int_T p_width0 = mxGetNumberOfElements(PARAM_DEF0(S));
  const int_T p_width1 = mxGetNumberOfElements(PARAM_DEF1(S));
  const int_T p_width2 = mxGetNumberOfElements(PARAM_DEF2(S));
  const uint8_T *host = (const uint8_T *) mxGetUint8s(PARAM_DEF0(S));
  const int32_T *port = (const int32_T *) mxGetInt32s(PARAM_DEF1(S));
  const uint8_T *passwd = (const uint8_T *) mxGetUint8s(PARAM_DEF2(S));
  uint8_T *host_t = (uint8_T *)ssGetDWork(S, 0);
  int32_T *port_t = (int32_T *)ssGetDWork(S, 1);
  uint8_T *passwd_t = (uint8_T *)ssGetDWork(S, 2);
  NDTransposeBySrcSpecsMwSize((void*)host_t, (const void*)host, mxGetDimensions
    (PARAM_DEF0(S)), mxGetNumberOfDimensions(PARAM_DEF0(S)), sizeof(uint8_T));
  NDTransposeBySrcSpecsMwSize((void*)port_t, (const void*)port, mxGetDimensions
    (PARAM_DEF1(S)), mxGetNumberOfDimensions(PARAM_DEF1(S)), sizeof(int32_T));
  NDTransposeBySrcSpecsMwSize((void*)passwd_t, (const void*)passwd,
    mxGetDimensions (PARAM_DEF2(S)), mxGetNumberOfDimensions(PARAM_DEF2(S)),
    sizeof(uint8_T));
  sfRedis_Terminate_wrapper(xC, xD, pW, host_t, p_width0, port_t, p_width1,
    passwd_t, p_width2, S);

  /* Free stored bus information */
  busInfoStruct *busInfo = (busInfoStruct *) ssGetUserData(S);
  if (busInfo != NULL) {
    free(busInfo);
  }

  if (!isBusDWorkPresent) {
    sfRedisBus** _u0BUS = (sfRedisBus**)ssGetDWork(S,3);
    if (*_u0BUS != NULL) {
      free(*_u0BUS);
    }

    *_u0BUS = NULL;
    sfRedisBus** _y0BUS = (sfRedisBus**)ssGetDWork(S,4);
    if (*_y0BUS != NULL) {
      free(*_y0BUS);
    }

    *_y0BUS = NULL;
  }
}

static int_T GetRTWEnvironmentMode(SimStruct *S)
{
  int_T status = -1;
  mxArray *plhs[1];
  mxArray *prhs[1];
  mxArray * err;

  /*
   * Get the name of the Simulink block diagram
   */
  prhs[0] = mxCreateString(ssGetBlockDiagramName(S));
  plhs[0] = NULL;

  /*
   * Call "isSimulationTarget = rtwenvironmentmode(modelName)" in MATLAB
   */
  err = mexCallMATLABWithTrap(1, plhs, 1, prhs, "rtwenvironmentmode");
  mxDestroyArray(prhs[0]);

  /*
   * Set the error status if an error occurred
   */
  if (err) {
    if (plhs[0]) {
      mxDestroyArray(plhs[0]);
      plhs[0] = NULL;
    }

    ssSetLocalErrorStatus(S,
                          "Unknown error during call to 'rtwenvironmentmode'.");
    return -1;
  }

  /*
   * Get the value returned by rtwenvironmentmode(modelName)
   */
  if (plhs[0]) {
    status = (int_T) (mxGetScalar(plhs[0]) != 0);
    mxDestroyArray(plhs[0]);
    plhs[0] = NULL;
  }

  return (status);
}

